import React, { useState } from 'react';
function MailList(){
    const [buttonHeight, setButtonHeight] = useState(80); // Altezza iniziale del button

    function increaseButtonHeight() {
      setButtonHeight(100); // Aumenta l'altezza del button di 10 pixel
    };
    return (
        <div className="list-group" data-bs-theme="dark" style={{borderRadius: '0px'}}>
            <button type="button" className="list-group-item list-group-item-action" style={{backgroundColor: '#051128', height: `${buttonHeight}px`}} onClick={increaseButtonHeight} >The current button</button>
            <button type="button" className="list-group-item list-group-item-action" style={{backgroundColor: '#051128', height: `${buttonHeight}px`}} onClick={increaseButtonHeight} >A second button item</button>
            <button type="button" className="list-group-item list-group-item-action" style={{backgroundColor: '#051128', height: `${buttonHeight}px`}} onClick={increaseButtonHeight} >A third button item</button>
            <button type="button" className="list-group-item list-group-item-action" style={{backgroundColor: '#051128', height: `${buttonHeight}px`}} onClick={increaseButtonHeight} >A fourth button item</button>
            <button type="button" className="list-group-item list-group-item-action" style={{backgroundColor: '#051128', height: `${buttonHeight}px`}} onClick={increaseButtonHeight} >A disabled button item</button>
        </div>
    );
}

export default MailList;
